  multiSort(array, sortObject = {}) {
    console.log("Array");
    console.log(array);
    const sortKeys = Object.keys(sortObject); // Return array if no sort object is supplied.

    if (!sortKeys.length) {
      return array;
    } // Change the values of the sortObject keys to -1, 0, or 1.


    for (var key in sortObject) {
      sortObject[key] = sortObject[key] === 'desc' || sortObject[key] === -1 ? -1 : sortObject[key] === 'skip' || sortObject[key] === 0 ? 0 : 1;
    }

    const keySort = (a, b, direction) => {
      direction = direction !== null ? direction : 1;

      if (a === b) {
        // If the values are the same, do not switch positions.
        return 0;
      } // If b > a, multiply by -1 to get the reverse direction.


      return a > b ? direction : -1 * direction;
    };

    return array.sort((a, b) => {
      var sorted = 0;
      var index = 0; // Loop until sorted (-1 or 1) or until the sort keys have been processed.

      while (sorted === 0 && index < sortKeys.length) {
        const key = sortKeys[index];

        if (key) {
          const direction = sortObject[key];
          sorted = keySort(a['signalActual'][key], b['signalActual'][key], direction);
          index++;
        }
      }

      return sorted;
    });
  }

  dateFormat(date) {
    //alert(date);
    if (date != null) {
      let todayDate = new Date(date);
      let format = "AM";
      let hour = todayDate.getHours();
      let min = todayDate.getMinutes(); //if(hour>11){format="PM";}
      //if (hour   > 12) { hour = hour - 12; }
      //if (hour   == 0) { hour = 12; }  

      if (min < 10) {
        min = "0" + min;
      } //document.write(todayDate.getMonth()+1 + " / " + todayDate.getDate() + " / " +  todayDate.getFullYear()+" "+hour+":"+min+" "+format);


      var str = todayDate.getDate() + "." + (todayDate.getMonth() + 1) + "." + todayDate.getFullYear() + " | " + hour + "." + min;
      return str;
    } else {
      return "-";
    }
  }

